import React from 'react';

import Day from "./Day";
import './Week.css';

const Week = (props) => {

    return (
        <div className="week-wrapper">
            <ul>
                {
                    Object.keys(props.week).map((keyName, keyIndex) => {
                        return <Day 
                            day={keyName}
                            state={props.week[keyName]}
                        />
                    })
                }
            </ul>
        </div>
    )

}

export default Week;
